// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "./Library.sol";

contract TechnoLimeStore {

    constructor ()public payable{}

    struct Product {
        uint price;
        uint quantity;
        string name;
        bool exists;
    }

    struct Transaction {
        uint blockNum;
        uint price;
        // 1-paid,2-refunded - prevent refunding from happening more than once
        uint status; 
    }

    // Using the iterable mapping technique
    // Checking available products - and their id (the index in the array)
    string[] public availableProducts;
    mapping(uint => Product) public products;

    // 0(1) lookup time when checking if a product already exists before adding it to store
    mapping(string => bool) productMap;

    // Storing all transactions
    mapping(uint => mapping(address => Transaction)) public transactions;

    // Keeping track of the funds that have to be refunded to the buyers
    mapping (address =>uint) public pendingWithdrawals;

    // calldata is cheaper 
    function addNewProduct(string calldata _name, uint _price,uint _quantity) external{
         if (!productMap[_name]){
             Product memory product;
             product.price = _price;
             product.quantity = _quantity;
             product.name = _name;
             product.exists = true;
             products[availableProducts.length] = product;
             productMap[_name] = true;
             availableProducts.push(_name);
         }else{
            //  Using descriptive custom error name instead of string description - to save a bit of gas;
             revert Errors.ProductExists();
         }
        
    }

    function addQuantity(uint _id,uint _quantity) external{
        if (products[_id].exists){
            products[_id].quantity += _quantity;
        }else{
            //  Using descriptive custom error name instead of string description - to save a bit of gas;
            revert Errors.ProductNotExistent();
        }
    }

    // Following the Checks-Effects-Interactions Pattern - to prevent from Re-entrancy Attack
    function buyProduct (uint _id)  external payable { 
        // Using short-circuiting to prevent more gas-costly code from running in case of condition fail
        if(_id < availableProducts.length && transactions[_id][msg.sender].status != 1){
            // Loading state variables to memory ( to modify and access them) and then saving them to storage again - more gas efficient
            Product memory product= products[_id];
            if(msg.value < product.price || product.quantity < 1)
                // Combined custom error for lower gas consumption
                revert Errors.LessThanPriceOrOutOfStock();

            Transaction memory newTransaction;
            newTransaction.blockNum = block.number;
            newTransaction.price = product.price;
            newTransaction.status = 1;
            // save to storage
            transactions[_id][msg.sender] = newTransaction;

            products[_id].quantity--;
            
            // Log the transaction
            emit Events.NewTransaction(_id,msg.sender,product.price,block.timestamp);

        }else{
            // Combined custom error for lower gas consumption
            revert Errors.ItemIdWrongOrBoughtAlready();
        }   
        
    }

    
    function returnProduct(uint _id) external {
        // Copying state variables to a new memory variable is not very cheap, so we copy it only in case the transaction exists.
        // This way we save gas everytime someone tries to return a product that he did not buy.
        if (transactions[_id][msg.sender].status == 1){ 
            // Now we can copy to memory, because it will be cheaper when accessing properties multiple times.
            Transaction memory transaction = transactions[_id][msg.sender];
            if((block.number - transaction.blockNum) > 100)
                revert Errors.Blocks100Exceeded();

            // Mark as refunded
            transactions[_id][msg.sender].status = 2;
            // Update quantity
            products[_id].quantity ++;
            //Add new Withdrawal
            pendingWithdrawals[msg.sender]+=transaction.price;

            // Log the return
            emit Events.NewReturn(msg.sender,_id,transaction.price,block.timestamp);
            
        }else {
            //  Using descriptive custom error name instead of string description - to save a bit of gas;
            revert Errors.TransactionNotExistent();
        }
    }

    // Following the best practices and creating a separate function for ether withdrawal 
    // instead of doing it automatically in the previous function
    function withdraw() public {
        if (pendingWithdrawals[msg.sender] > 0){
            // Following the Checks-Effects-Interactions Pattern - to prevent from Re-entrancy Attack and multiple Refunding
            uint amount = pendingWithdrawals[msg.sender];
            // Refund of 15K Gas for reassigning a storage value to 0.
            pendingWithdrawals[msg.sender]=0;
            payable(msg.sender).call{value:amount}("");
        }else{
            revert Errors.NothingToRefund();
        }
    }

    
    
}

